import React, { useState } from "react";
import {
  Button,
  TextField,
  Container,
  Typography,
  MenuItem,
  Select,
  InputLabel,
  FormControl,
  Grid,
  Box,
  FormHelperText,
} from "@mui/material";
import axios from "axios";

function ReservationForm() {
  const [space, setSpace] = useState("");
  const [resource, setResource] = useState("");
  const [date, setDate] = useState("");
  const [time, setTime] = useState("");
  const [error, setError] = useState("");

  const handleReservation = async () => {
    if (!space && !resource) {
      setError("You must select either a space or a resource.");
      return;
    }
    const reservationData = { space, resource, date, time };
    try {
      await axios.post(
        "http://127.0.0.1:5000/api/reservations",
        reservationData,
        {
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      alert("Reservation made successfully!");
      setError(""); // Clear any previous error message
    } catch (error) {
      // Log detailed error information for debugging
      console.error("Error making reservation:", error);
      alert("Error making reservation. Check console for details.");
    }
  };

  return (
    <Container sx={{ paddingTop: "40px" }}>
      <Typography variant="h4" gutterBottom sx={{ fontWeight: "bold" }}>
        Reserve a Space or Resource
      </Typography>
      
      <Grid container spacing={3}>
        {/* Space Selection */}
        <Grid item xs={12} sm={6}>
          <FormControl fullWidth>
            <InputLabel>Space</InputLabel>
            <Select
              value={space}
              onChange={(e) => setSpace(e.target.value)}
              displayEmpty
            >
              <MenuItem value="">
                <em>None</em>
              </MenuItem>
              <MenuItem value="courtroom">Salle dans le Tribunal de Commerce de Casablanca</MenuItem>
              <MenuItem value="meeting-room">Salle de r√©union</MenuItem>
            </Select>
            {error && !space && !resource && (
              <FormHelperText error>{error}</FormHelperText>
            )}
          </FormControl>
        </Grid>

        {/* Resource Selection */}
        <Grid item xs={12} sm={6}>
          <FormControl fullWidth>
            <InputLabel>Resource</InputLabel>
            <Select
              value={resource}
              onChange={(e) => setResource(e.target.value)}
              displayEmpty
            >
              <MenuItem value="">
                <em>None</em>
              </MenuItem>
              <MenuItem value="court-record">Ressource au Tribunal de Commerce de Casablanca</MenuItem>
              <MenuItem value="documents">Documents</MenuItem>
            </Select>
            {error && !space && !resource && (
              <FormHelperText error>{error}</FormHelperText>
            )}
          </FormControl>
        </Grid>

        {/* Date Input */}
        <Grid item xs={12} sm={6}>
          <TextField
            label="Date"
            type="date"
            fullWidth
            value={date}
            onChange={(e) => setDate(e.target.value)}
            margin="normal"
            InputLabelProps={{
              shrink: true,
            }}
          />
        </Grid>

        {/* Time Input */}
        <Grid item xs={12} sm={6}>
          <TextField
            label="Time"
            type="time"
            fullWidth
            value={time}
            onChange={(e) => setTime(e.target.value)}
            margin="normal"
            InputLabelProps={{
              shrink: true,
            }}
          />
        </Grid>

        {/* Reservation Button */}
        <Grid item xs={12}>
          <Box sx={{ display: 'flex', justifyContent: 'flex-end' }}>
            <Button
              variant="contained"
              onClick={handleReservation}
              sx={{
                backgroundColor: "#3f51b5",
                color: "#fff",
                '&:hover': {
                  backgroundColor: "#303f9f",
                },
              }}
            >
              Make Reservation
            </Button>
          </Box>
        </Grid>
      </Grid>
    </Container>
  );
}

export default ReservationForm;
